var dsr = new GlideRecord('x_15401_data_gover_data_sharing_agreement');
dsr.addQuery('data_sharing_request', current.data_sharing_request);
dsr.addQuery('status', '!=', 'Approved');
dsr.query();
var approvalsDone = true;
while(dsr.next()) {
	approvalsDone = false;
}
//If all the approvals are done set the DSR to Approved
if(approvalsDone) {
	dsr.status = "Approved";
}

