answer = isPublic();

function isPublic() {
	var add = new GlideRecord('x_15401_data_gover_m2m_additional_df_to_dsa');
	add.addEncodedQuery('data_field.classification=Public^data_sharing_aggreement=' + current.sys_id);
	add.query();
	while(add.next()) {
		return "no";
	}
	var req = new GlideRecord('x_15401_data_gover_m2m_required_df_to_dsa');
	req.addEncodedQuery('data_field.classification=Public^data_sharing_aggreement=' + current.sys_id);
	req.query();
	if(req.next()) {
		return "no";
	}
	return "yes";
}

